import './App.css';
import CardsSection from './components/CardsSection/CardsSection';
import Header from './components/Header/Header';
import Intro from './components/Intro/Intro';

function App() {
  return (
    <div className="App">
      <Header/>
      <Intro/>
      <CardsSection/>
      </div>
  );
}

export default App;
